function log(message) {
  if (typeof message === 'string') {
    console.log('WMESpeedhelper: ' + message);
  } else {
    console.log('WMESpeedhelper: ', message);
  }
}

// wait for wme ready then call WMESpeedhelper_init
function WMESpeedhelper_bootstrap() {
  if (typeof W === 'object' && W.userscripts?.state.isReady) {
    WMESpeedhelper_init();
  } else {
    document.addEventListener("wme-ready", WMESpeedhelper_init, {
      once: true,
    });
  }
}

function WMESpeedhelper_init() {
  //create the WMESpeedhelper object
  var WMESpeedhelper = {},
    editpanel = $("#edit-panel"),
    mD = document.createElement("div"),
    mC = document.createElement("div"),
    mI = document.createElement("img"),
    mT = document.createElement("div"),
    cleardiv = document.createElement("div"),
    signsError = document.createElement("div");

  // Check initialisation
  if (typeof W == 'undefined' || typeof I18n == 'undefined') {
    setTimeout(WMESpeedhelper_init, 660);
    log('Waze object unavailable, map still loading');
    return;
  }
  if (editpanel === undefined) {
    setTimeout(WMESpeedhelper_init, 660);
    log('edit-panel info unavailable, map still loading');
    return;
  }

  log("Start");
  // Show friendly message to users of unsupported countries (for now)
  WMESpeedhelper.showMessage = function() {
    // Check if the user hasn't allready asked to hide this message
    if (localStorage.msgHide !== 1) {
      // Check if this message isn't allready on screen (bugcheck, can't reproduce myself)
      if (!$("#_cnt").length) {
        mD.id = '_cnt';
        mD.style.cssText = 'margin:5px 0 10px 0;border:1px solid red;padding:5px;border-radius:5px;position:relative';
        mC.style.cssText ='cursor:pointer;width:16px;height:16px;position:absolute;right:3px;top:3px;background-image:url(\'data:image/png;base64,\');';
        mD.appendChild(mC);
        mI.style.cssText = 'float:left;margin-right:5px;';
        mI.src = mssimg;
        mT.innerHTML = '<b><a href="https://greasyfork.org/en/scripts/13774-wme-speedhelper" target="_blank">WME Speedhelper '+VERSION+'</a></b><br>Country missing? Follow <a href="https://greasyfork.org/en/scripts/13774-wme-speedhelper" target="_blank">this</a> link Your country code: <b>'+W.model.getTopCountry().getAttribute('abbr')+'</b>';
        mC.onclick = function() {
          localStorage.msgHide = 1;
          $('#_cnt').hide('slow');
        };
        cleardiv.id = 'cleardiv';
        cleardiv.style.cssText ='clear:both;margin-bottom:5px;';

        mD.appendChild(mI);
        mD.appendChild(mT);
        mD.appendChild(cleardiv);
        var $sldiv = $("div.speed-limit-fwd");
        if ($sldiv.length === 0) { $sldiv = $("div.speed-limit-rev"); }
        $sldiv.prepend(mD);
      }
    }
  };

  WMESpeedhelper.showMessage2 = function() {
    if (!$("#mss2").length) {
      mD.id = 'mss2';
      mD.style.cssText = 'margin:5px 0 10px 0;border:1px solid red;padding:5px;border-radius:5px;position:relative;font-size:90%;background:#FFE7E7';
      mI.style.cssText = 'float:left;margin-right:5px;width:25px;height:25px';
      mI.src = BGa[0];
      mT.innerHTML = '<b>WME is currently set to imperial. Please change this to metric, if you want to add speedlimits in this country ('+W.model.getTopCountry().getAttribute('abbr')+')</b>';
      cleardiv.id = 'cleardiv';
      cleardiv.style.cssText ='clear:both;margin-bottom:5px;';
      mD.appendChild(mI);
      mD.appendChild(mT);
      mD.appendChild(cleardiv);
      var $sldiv = $("div.speed-limit-fwd");
      if ($sldiv.length === 0) { $sldiv = $("div.speed-limit-rev"); }
      $sldiv.prepend(mD);
    }
  };

  // The big one...
  WMESpeedhelper.makeSigns = function(receiver) {
    // Fix thankx to GyllieGyllie (0.12.1)
    var country = W.model.getTopCountry();
    var countryID;

    if (country.hasOwnProperty("abbr")) {
      countryID = country.abbr;
    } else {
      countryID = country.getAttribute("abbr");
    }

    var ABBR = signConfig[countryID];

    // Country code not found? Show user friendly message with info to get his/her country added
    if (typeof ABBR == 'undefined') {
      WMESpeedhelper.showMessage();
      return;
    }
    var MPHorKPH = ABBR.ann, ISEMPERIAL = W.model.isImperial

    // Hide signs if the user's settings are not correct.
    if(ISEMPERIAL && MPHorKPH === 'kph'){
      WMESpeedhelper.showMessage2();
      return;
    }

    /*************
     * EDIT PANEL *
     *************/
    // check if we're not adding to existing signs
    if (!$("#signsholder").length) {
      var signsholder = document.createElement("div");
      signsholder.id = 'signsholder';

      //Get the correct list of speedsigns to make
      ABBR.spd.forEach(function(speed) {
        var bgimage = ABBR.sgn[0];
        var allowedspeed = speed;
        var dims = ABBR.sgn[1].split('|');
        var hidden = '';

        //check per speedvalue if we need a special image
        try {
          if(Array.isArray(speed)) {
            allowedspeed = speed[0];
            bgimage = speed[1][0];
            dims = speed[1][1].split('|');
            hidden = 'visibility:hidden;';
          }
        } catch (e) {
          //
        }

        // The sign background
        var addsign = document.createElement("div");
        addsign.id = 'sign'+allowedspeed;

        // Get width/height of sign background img
        var scale = options.iconScale / 100;
        addsign.style.cssText = 'cursor:pointer;float:left;width:'+(dims[1]*scale)+'px;height:'+(dims[0]*scale)+'px;background-image: url(\''+ bgimage + '\');background-size:contain;';

        // Credits for some of these parts go to t0cableguy & Rickzabel
        addsign.onclick = WMESpeedhelper.clickSegment;

        // The speed value
        var speedvalue = document.createElement("div");
        speedvalue.id = 'spd_'+ allowedspeed;
        speedvalue.style.cssText = 'text-align:center;margin-top:'+(dims[2] - (dims[2]*2*(1 - scale)))+'px;font-size:' + (10 * scale) + 'px;font-family:\'Varela Round\',sans-serif;color:#000; font-weight:bold;visibility:'+dims[3];
        speedvalue.innerHTML = allowedspeed;
        addsign.appendChild(speedvalue);
        signsholder.appendChild(addsign);
      });

      // CSS Clear after the floats
      var cleardiv = document.createElement("div");
      cleardiv.style.cssText ='clear:both;margin-bottom:5px;';

      // Add everything to the stage
      signsholder.appendChild(cleardiv);
      var sldiv;
      if (receiver === undefined) {
        sldiv = document.querySelector("div.speed-limit-fwd");
        if (!sldiv) { document.querySelector("div.speed-limit-rev"); }
      }
      else { sldiv = receiver; }
      if (sldiv) {
        sldiv.parentElement.firstChild.insertAdjacentElement("afterend", signsholder);
      }

      // Lock warning (0.4.8)
      signsError.id = 'signsError';
      signsError.style.cssText = 'background:url(' + warningimg + ') no-repeat left center;border:1px solid #EBCCD1;background-color:#F2DEDE;color:#000;font-weight:bold;font-size:80%;border-radius:5px;padding:10px 5px 10px 45px;margin:8px 0;';
      signsError.innerHTML = 'One or more segments in your selection are disabled, out of your editing area or above your editor level.';

      if($("wz-text-input[name=fwdMaxSpeed]").prop('disabled') || $("wz-text-input[name=revMaxSpeed]").prop('disabled')) {
        $('#signsholder').append(signsError);
      }

      log('ready');

      /*****************
       * SETTINGS PANEL *
       *****************/
      // Clearfields
      var _clear = document.createElement("span");
      _clear.title = "Clear values";
      _clear.onclick = function() {
        if(!$("wz-text-input[name=fwdMaxSpeed]").prop('disabled') && !$("input[name=revMaxSpeed]").prop('disabled')) {
          $("wz-text-input[name=fwdMaxSpeed]").val('').change().focusout();
          $("wz-text-input[name=revMaxSpeed]").val('').change().focusout();
        }
      };
      _clear.style.cssText = 'cursor:pointer;float:right;background-image:url("'+ clearimg +'");width:12px;height:12px;';
      sldiv.append(_clear);
    }
  };

  WMESpeedhelper.makeCameraSigns = function(speedcameraDiv) {
    log("making camera signs");
    // check if we're not adding to existing signs
    if (!$("#camsignsholder").length) {
      var camsignsholder = document.createElement("div");

      var country = W.model.getTopCountry();
      var countryID;

      if (country.hasOwnProperty("abbr")) {
        countryID = country.abbr;
      } else {
        countryID = country.getAttribute("abbr");
      }
      var ABBR =  signConfig[countryID];
      camsignsholder.id = 'camsignsholder';

      //Get the correct list of speedsigns to make
      ABBR.spd.forEach(function(speed) {
        var bgimage = ABBR.sgn[0];
        var allowedspeed = speed;
        var dims = ABBR.sgn[1].split('|');
        var hidden = '';

        //check per speedvalue if we need a special image
        try {
          if(Array.isArray(speed)) {
            allowedspeed = speed[0];
            bgimage = speed[1][0];
            dims = speed[1][1].split('|');
            hidden = 'visibility:hidden;';
          }
        } catch (e) {
          //
        }

        // The sign background
        var addsign = document.createElement("div");
        addsign.id = 'sign'+allowedspeed;

        // Get width/height of sign background img
        addsign.style.cssText = 'cursor:pointer;float:left;width:'+dims[1]+'px;height:'+dims[0]+'px;background-image: url(\''+ bgimage + '\');';

        addsign.onclick = function() {
          var focusOut = new Event('focusout', {bubbles: true});
          $("wz-text-input.max-speed").val(allowedspeed).get(0)?.dispatchEvent(focusOut);
        };

        // The speed value
        var speedvalue = document.createElement("div");
        speedvalue.id = 'spd_'+ allowedspeed;
        speedvalue.style.cssText = 'text-align:center;margin-top:'+dims[2]+'px;font-size:10px;font-family:\'Varela Round\',sans-serif;color:#000; font-weight:bold;visibility:'+dims[3];
        speedvalue.innerHTML = allowedspeed;
        addsign.appendChild(speedvalue);
        camsignsholder.appendChild(addsign);
      });

      // Add all this to the screen
      var maxSpeed = document.querySelector("wz-text-input.max-speed:not(.hidden)");
      if (maxSpeed) {
        let labelContainer = maxSpeed.shadowRoot.querySelector('.label-container');
        if (labelContainer) {
          labelContainer.insertAdjacentElement("afterend", camsignsholder);
        } else {
          let shadowRootObserver = new MutationObserver(function(mutations) {
            maxSpeed.shadowRoot.querySelector('.label-container').insertAdjacentElement("afterend", camsignsholder);
          });
          shadowRootObserver.observe(maxSpeed.shadowRoot, { childList: true, subtree: false });
        }
      }
    }
  };

  WMESpeedhelper.clickSegment = function() {
    // Disable & remove new WME verify buttons.
    // Tried to find the most simple & short code as possible, that works.
    // First remove the "disabled" property, followed by a click action
    // on the edit buttons seems to do the trick
    $("wz-text-input[name=fwdMaxSpeed]").prop('disabled', false);
    $("wz-text-input[name=revMaxSpeed]").prop('disabled', false);
    $("button.edit-btn").click();

    if(!$("wz-text-input[name=fwdMaxSpeed]").prop('disabled') && !$("wz-text-input[name=revMaxSpeed]").prop('disabled')) {
      console.log('Changing speed');
      var focusOut = new Event('focusout', {bubbles: true});
      if ((!ISEMPERIAL && MPHorKPH === 'mph') ||  (ISEMPERIAL && MPHorKPH === 'kph')) {
        var ConvertedSpeed = "";

        if (!ISEMPERIAL && MPHorKPH === 'mph') {
          //convert to kmh
          ConvertedSpeed = Math.round(allowedspeed * 1.609344); //km/h = mph x 1.609344
          $("wz-text-input[name=fwdMaxSpeed]").val(ConvertedSpeed).get(0)?.dispatchEvent(focusOut);
          $("wz-text-input[name=revMaxSpeed]").val(ConvertedSpeed).get(0)?.dispatchEvent(focusOut);
        }
      } else {
        //waze is set to the correct country unit
        $("wz-text-input[name=fwdMaxSpeed]").val(allowedspeed).get(0)?.dispatchEvent(focusOut);
        $("wz-text-input[name=revMaxSpeed]").val(allowedspeed).get(0)?.dispatchEvent(focusOut);
      }
    }
  }

  // check for changes in the edit-panel
  var speedlimitsObserver = new MutationObserver(function(mutations) {
    mutations.forEach(function(mutation) {
      // Mutation is a NodeList and doesn't support forEach like an array
      for (var i = 0; i < mutation.addedNodes.length; i++) {
        var addedNode = mutation.addedNodes[i];

        // Only fire up if it's a node
        if (addedNode.nodeType === Node.ELEMENT_NODE) {
          console.log('Checking for nodes');
          var speedlimitDiv = addedNode.querySelector('div.speed-limit-fwd');
          if (!speedlimitDiv) { speedlimitDiv = addedNode.querySelector('div.speed-limit-rev'); }
          var speedcameraDiv = addedNode.querySelector('wz-text-input.max-speed');

          if (speedlimitDiv) {
            WMESpeedhelper.makeSigns(speedlimitDiv);
          }
          if (speedcameraDiv) {
            WMESpeedhelper.makeCameraSigns(speedcameraDiv);
          }
        }
      }
    });
  });
  speedlimitsObserver.observe(document.getElementById('edit-panel'), { childList: true, subtree: true });

  // Catch permalinks
  WMESpeedhelper.makeSigns();
  WMESpeedhelper.makeCameraSigns();

  constructSettings();

}
